import React, {useState, useEffect} from 'react';
import axios from 'axios';
import DisplayUser from './DisplayUser';
import './App.css';
function FetchUser() {
    const [posts, setPosts] = useState([])
    const fetchUrl = 'https://api.spaceXdata.com/v3/launches?limit=100';
    useEffect(() => {
        axios.get(fetchUrl)
        .then(res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch(err =>{
             console.log(err)
        })
    },[])

    return(
            <div className="wrapper">
            <h1>SpaceX Launch Programs</h1>
            <h2>filters</h2>  
            <h2 className="launch-year">Launch Year</h2>
            <hr/>  
            {
            posts.map(item => {            
            return <DisplayUser data={item} />
            })
            }
            </div>
    )
    
}

export default FetchUser
